import Header from '../components/Header';
import Sidebar from '../components/Sidebar';

function Layout({ categories, children }) {
    return (
        <div>
            <Header categories={categories} />
            <div className="layout-lower">
                {children}
                <Sidebar />
            </div>
            <style jsx>{`
                .layout-lower {
                    display: flex;
                }
            `}</style>
        </div>
    )
}

export default Layout
